import React from "react";
import "./Navbar.css";
import logo from "../Images/no-bg111.png"

const Navbar = ({ onNavClick }) => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Logo" />
        <h1>MyCompany</h1>
      </div>
      <ul className="navbar-links">
        <li><button onClick={() => onNavClick("home")}>Home</button></li>
        <li><button onClick={() => onNavClick("jobs")}>Jobs</button></li>
        <li><button onClick={() => onNavClick("internships")}>Internships</button></li>
        <li><button onClick={() => onNavClick("about")}>About Us</button></li>
      </ul>
    </nav>
  );
};

export default Navbar;
